import React from "react";

// @mui material components
import { Grid } from "@mui/material";

// Material Dashboard 2 React components
import DashboardLayout from "examples/LayoutContainers/DashboardLayout";
import MDBox from "components/MDBox";
import DashboardNavbar from "examples/Navbars/DashboardNavbar";

// Charts
import VerticalBarChart from "examples/Charts/BarCharts/VerticalBarChart";
import DefaultLineChart from "examples/Charts/LineCharts/DefaultLineChart";

// Data
import totalAferese from "layouts/dashboard/data/totalAferese";
import totalComponents from "layouts/trima/components/data/offered_collected";
import LastDonations from "layouts/reveos/components/data/lastDonations";
import donorhbht from "layouts/trima/components/data/hthb";
import donorPlt from "layouts/trima/components/data/platelet";
import apheresisDuration from "layouts/trima/components/data/duration";

function Trima() {
  const aferese = totalAferese();
  const components = totalComponents();
  const hbht = donorhbht();
  const plt = donorPlt();
  const duration = apheresisDuration();

  return (
    <DashboardLayout>
      <DashboardNavbar />
      <MDBox py={3}>
        <Grid container spacing={3}>
          <Grid item xs={12} md={8}>
            <Grid container spacing={3}>
              <Grid item xs={12} md={6} mb={3}>
                <VerticalBarChart
                  icon={{ color: "dark", component: "leaderboard" }}
                  title="Unidades processadas"
                  description="Total de unidades processadas por mês"
                  height="10rem"
                  chart={aferese}
                />
              </Grid>
              <Grid item xs={12} md={6} mb={3}>
                <VerticalBarChart
                  icon={{ color: "dark", component: "schedule" }}
                  title="Duração"
                  description="Duração média dos processos por unidade"
                  height="10rem"
                  chart={duration}
                />
              </Grid>
              <Grid item xs={12} md={6} mb={3}>
                <VerticalBarChart
                  icon={{ color: "dark", component: "bloodtype" }}
                  title="Volume Plaquetas"
                  description="Volume médio das plaquetas"
                  height="8rem"
                  chart={duration}
                />
              </Grid>
              <Grid item xs={12} md={6} mb={3}>
                <VerticalBarChart
                  icon={{ color: "dark", component: "bloodtype" }}
                  title="PYI Plaquetas"
                  description="Índice plaquetário"
                  height="8rem"
                  chart={duration}
                />
              </Grid>
              <Grid item xs={12} md={6} mb={3}>
                <VerticalBarChart
                  icon={{ color: "dark", component: "bloodtype" }}
                  title="Volume Plasma"
                  description="Volume médio do plasma"
                  height="8rem"
                  chart={aferese}
                />
              </Grid>
              <Grid item xs={12} md={6} mb={3}>
                <VerticalBarChart
                  icon={{ color: "dark", component: "bloodtype" }}
                  title="Volume Leucócitos"
                  description="Volume médio do pacote leucocitário"
                  height="8rem"
                  chart={aferese}
                />
              </Grid>
            </Grid>
          </Grid>
          <Grid item xs={12} md={4}>
            <LastDonations />
          </Grid>
        </Grid>
      </MDBox>
    </DashboardLayout>
  );
}

export default Trima;
